contracts/NFTMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Address.sol";

contract NFTMarketplace {
    using Address for address;

    struct Listing {
        address seller;
        address nftContract;
        uint256 tokenId;
        uint256 price;
        string metadataURI;
        string description;
        bool isVerified;
    }

    struct Collection {
        address owner;
        string name;
        string metadataURI;
        uint256[] tokenIds;
        uint256 price;
        bool isListed;
    }

    struct CollectionStats {
        uint256 tradingVolume;
        uint256 lastUpdated;
    }

    mapping(uint256 => Listing) private listings;
    uint256 private listingCounter;

    mapping(uint256 => Collection) private collections;
    uint256 private collectionCounter;

    mapping(address => uint256) private sellerEarnings;
    mapping(uint256 => uint256) private nftEarnings;
    mapping(address => CollectionStats) private collectionStats;

    address private admin;

    event NFTListed(
        uint256 indexed listingId,
        address indexed seller,
        uint256 price
    );
    event NFTSold(
        uint256 indexed listingId,
        address indexed buyer,
        uint256 price
    );
    event CollectionCreated(
        uint256 indexed collectionId,
        address indexed owner,
        string name
    );
    event CollectionSold(
        uint256 indexed collectionId,
        address indexed buyer,
        uint256 price
    );
    event EarningsWithdrawn(address indexed seller, uint256 amount);
    event NFTVerified(uint256 indexed listingId);
    event NFTUpdated(uint256 indexed listingId);
    event NFTDeleted(uint256 indexed listingId);
    event CollectionUpdated(uint256 indexed collectionId);
    event CollectionDeleted(uint256 indexed collectionId);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier isOwner(
        address nftContract,
        uint256 tokenId,
        address sender
    ) {
        require(
            IERC721(nftContract).ownerOf(tokenId) == sender,
            "Caller is not the owner"
        );
        _;
    }

    modifier isListed(uint256 listingId) {
        require(listings[listingId].price > 0, "NFT is not listed for sale");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function createNFT(
        address nftContract,
        uint256 tokenId,
        string calldata metadataURI,
        string calldata description
    ) external isOwner(nftContract, tokenId, msg.sender) {
        listings[listingCounter] = Listing({
            seller: msg.sender,
            nftContract: nftContract,
            tokenId: tokenId,
            price: 0,
            metadataURI: metadataURI,
            description: description,
            isVerified: false
        });
        listingCounter++;
    }

    function listNFT(
        address nftContract,
        uint256 tokenId,
        uint256 price
    ) external isOwner(nftContract, tokenId, msg.sender) {
        require(price > 0, "Price must be greater than zero");
        IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

        listings[listingCounter] = Listing({
            seller: msg.sender,
            nftContract: nftContract,
            tokenId: tokenId,
            price: price,
            metadataURI: "",
            description: "",
            isVerified: false
        });

        emit NFTListed(listingCounter, msg.sender, price);
        listingCounter++;
    }

    function buyNFT(uint256 listingId) external payable isListed(listingId) {
        Listing memory listing = listings[listingId];
        require(msg.value >= listing.price, "Insufficient payment");

        IERC721(listing.nftContract).transferFrom(
            address(this),
            msg.sender,
            listing.tokenId
        );

        sellerEarnings[listing.seller] += msg.value;
        nftEarnings[listingId] += msg.value;

        emit NFTSold(listingId, msg.sender, listing.price);
        delete listings[listingId];
    }

    function verifyNFT(uint256 listingId) external onlyAdmin {
        listings[listingId].isVerified = true;
        emit NFTVerified(listingId);
    }

    function updateNFT(
        uint256 listingId,
        uint256 price,
        string calldata metadataURI,
        string calldata description
    ) external onlyAdmin {
        Listing storage listing = listings[listingId];
        listing.price = price;
        listing.metadataURI = metadataURI;
        listing.description = description;

        emit NFTUpdated(listingId);
    }

    function deleteNFT(uint256 listingId) external onlyAdmin {
        delete listings[listingId];
        emit NFTDeleted(listingId);
    }

    function getListing(
        uint256 listingId
    ) external view returns (Listing memory) {
        return listings[listingId];
    }

    function getNFTEarnings(uint256 listingId) external view returns (uint256) {
        return nftEarnings[listingId];
    }

    function createNFTCollection(
        string calldata name,
        string calldata metadataURI,
        uint256[] calldata tokenIds
    ) external {
        collections[collectionCounter] = Collection({
            owner: msg.sender,
            name: name,
            metadataURI: metadataURI,
            tokenIds: tokenIds,
            price: 0,
            isListed: false
        });
        emit CollectionCreated(collectionCounter, msg.sender, name);
        collectionCounter++;
    }

    function listNFTCollection(uint256 collectionId, uint256 price) external {
        Collection storage collection = collections[collectionId];
        require(
            collection.owner == msg.sender,
            "Not the owner of this collection"
        );
        require(price > 0, "Price must be greater than zero");

        collection.price = price;
        collection.isListed = true;
    }

    function buyNFTCollection(uint256 collectionId) external payable {
        Collection storage collection = collections[collectionId];
        require(collection.isListed, "Collection is not listed for sale");
        require(msg.value >= collection.price, "Insufficient payment");

        for (uint256 i = 0; i < collection.tokenIds.length; i++) {
            IERC721(collection.owner).transferFrom(
                collection.owner,
                msg.sender,
                collection.tokenIds[i]
            );
        }

        sellerEarnings[collection.owner] += msg.value;
        collection.isListed = false;

        emit CollectionSold(collectionId, msg.sender, collection.price);
    }

    function sellNFTCollection(uint256 collectionId, uint256 price) external {
        Collection storage collection = collections[collectionId];
        require(
            collection.owner == msg.sender,
            "Not the owner of this collection"
        );

        collection.price = price;
        collection.isListed = true;

        emit CollectionUpdated(collectionId);
    }

    function updateCollection(
        uint256 collectionId,
        string calldata name,
        string calldata metadataURI
    ) external onlyAdmin {
        Collection storage collection = collections[collectionId];
        collection.name = name;
        collection.metadataURI = metadataURI;

        emit CollectionUpdated(collectionId);
    }

    function deleteCollection(uint256 collectionId) external onlyAdmin {
        delete collections[collectionId];
        emit CollectionDeleted(collectionId);
    }

    function getCollection(
        uint256 collectionId
    ) external view returns (Collection memory) {
        return collections[collectionId];
    }

    function getCollectionCount() external view returns (uint256) {
        return collectionCounter;
    }

    function withdrawEarnings() external {
        uint256 earnings = sellerEarnings[msg.sender];
        require(earnings > 0, "No earnings to withdraw");

        sellerEarnings[msg.sender] = 0;
        payable(msg.sender).transfer(earnings);

        emit EarningsWithdrawn(msg.sender, earnings);
    }

    function getSellerEarnings(address seller) external view returns (uint256) {
        return sellerEarnings[seller];
    }

    function getUserEarnings(address user) external view returns (uint256) {
        return sellerEarnings[user];
    }

    function updateTradingVolume(address nftContract, uint256 amount) private {
        collectionStats[nftContract].tradingVolume += amount;
        collectionStats[nftContract].lastUpdated = block.timestamp;
    }

    function getRankings() external view returns (CollectionStats[] memory) {
        CollectionStats[] memory stats = new CollectionStats[](
            collectionCounter
        );
        for (uint256 i = 0; i < collectionCounter; i++) {
            stats[i] = collectionStats[collections[i].owner];
        }
        return stats;
    }
}

